We are going to use bats to write and automate our tests. Each test will be composed by the following steps: Run the policy using kwctl. Perform some assertions against the output produced by the kwctl. All the end-to-end tests are located inside of a file called e2e.bats. The scaffolded project already includes such a file. We will just change its contents to reflect how our policy behaves. As a final note, the end-to-end tests we will use the same test fixtures files we previously used inside of the Go unit tests. The first test ensures a request is approved when no settings are provided: @test "accept when no settings are provided" { run kwctl run -r test_data/ingress.json policy.wasm # this prints the output when one the checks below fails echo "output = ${output}" # request is accepted [ $(expr "$output" : '.*"allowed":true.*') -ne 0 ]
} We can execute the end-to-end tests by using this command: make e2e-tests This will produce the following output: bats e2e.bats ✓ accept when no settings are provided 1 test, 0 failures Let's write a test to ensure a request is approved when a user-defined constraint is respected: @test "accept user defined constraint is respected" { run kwctl run \ -r test_data/ingress.json \ --settings-json '{"constrained_labels": {"owner": "^team-"}}' \ policy.wasm # this prints the output when one the checks below fails echo "output = ${output}" # request is accepted [ $(expr "$output" : '.*"allowed":true.*') -ne 0 ]
} Next, we can write a test to ensure a request is accepted when none of the labels is on the deny list: @test "accept labels are not on deny list" { run kwctl run \ -r test_data/ingress.json \ --settings-json '{"denied_labels": ["foo", "bar"]}' \ policy.wasm # this prints the output when one the checks below fails echo "output = ${output}" # request is accepted [ $(expr "$output" : '.*"allowed":true.*') -ne 0 ]
} Let's improve the test coverage by adding a test that rejects a request because one of the labels is on the deny list: @test "reject because label is on deny list" { run kwctl run \ -r test_data/ingress.json \ --settings-json '{"denied_labels": ["foo", "owner"]}' \ policy.wasm # this prints the output when one the checks below fails echo "output = ${output}" # request is rejected [ $(expr "$output" : '.*"allowed":false.*') -ne 0 ] [[ "$output" == *"Label owner is on the deny list"* ]]
} The following test ensures a request is rejected when one of its labels doesn't satisfy the constraint provided by the user. @test "reject because label doesn't pass validation constraint" { run kwctl run \ -r test_data/ingress.json \ --settings-json '{"constrained_labels": {"cc-center": "^cc-\\d+$"}}' \ policy.wasm # this prints the output when one the checks below fails echo "output = ${output}" # request is rejected [ $(expr "$output" : '.*"allowed":false.*') -ne 0 ] [[ "$output" == *"The value of cc-center doesn't pass user-defined constraint"* ]]
} We want to ensure settings' validation is working properly. This can be done with the following tests: @test "fail settings validation because of conflicting labels" { run kwctl run \ -r test_data/ingress.json \ --settings-json '{"denied_labels": ["foo", "cc-center"], "constrained_labels": {"cc-center": "^cc-\\d+$"}}' \ policy.wasm # this prints the output when one the checks below fails echo "output = ${output}" # settings validation failed [ $(expr "$output" : '.*"valid":false.*') -ne 0 ] [[ "$output" == *"Provided settings are not valid: These labels cannot be constrained and denied at the same time: Set{cc-center}"* ]]
} @test "fail settings validation because of invalid constraint" { run kwctl run \ -r test_data/ingress.json \ --settings-json '{"constrained_labels": {"cc-center": "^cc-[12$"}}' \ policy.wasm # this prints the output when one the checks below fails echo "output = ${output}" [[ "$output" == *"Provided settings are not valid: error parsing regexp: missing closing ]: `[12$`"* ]]
}

