) type Settings struct { DeniedLabels mapset.Set `json:"denied_labels"` ConstrainedLabels map[string]*RegularExpression `json:"constrained_labels"`
} As you can see we're using the regexp package to handle regular expression objects, plus we use the mapset.Set structure to store the list of denied labels. The Settings struct has json attributes, we will use them later when writing our unit tests. The unit tests are going to be executed using Go official compiler, hence we will be able to leverage the encoding/json package. The Settings class is not using the official regexp.RegExp object to represent regular expressions. That's because the regexp.RegExp struct doesn't handle serialization and deserialization to JSON. This is the implementation of the RegularExpression struct: // A wrapper around the standard regexp.Regexp struct
// that implements marshalling and unmarshalling
type RegularExpression struct { *regexp.Regexp
} // Convenience method to build a regular expression
func CompileRegularExpression(expr string) (*RegularExpression, error) { nativeRegExp, err := regexp.Compile(expr) if err != nil { return nil, err } return &RegularExpression{nativeRegExp}, nil
} // UnmarshalText satisfies the encoding.TextMarshaler interface,
// also used by json.Unmarshal.
func (r *RegularExpression) UnmarshalText(text []byte) error { nativeRegExp, err := regexp.Compile(string(text)) if err != nil { return err } r.Regexp = nativeRegExp return nil
} // MarshalText satisfies the encoding.TextMarshaler interface,
// also used by json.Marshal.
func (r *RegularExpression) MarshalText() ([]byte, error) { if r.Regexp != nil { return []byte(r.Regexp.String()), nil } return nil, nil
}

