At runtime we can't rely on the automatic struct marshalling and unmarshalling provided by the encoding/json package due to TinyGo current limitations. Because of that we will create two initialization helpers: NewSettingsFromValidationReq: this is used when building a Settings instance starting from a ValidationRequest object NewSettingsFromValidateSettingsPayload: this is used when building a Settings instance inside of the validate_settings entry point. This entry point receives the "naked" Settings JSON dictionary This is the implementation of these functions: // Builds a new Settings instance starting from a validation
// request payload:
// {
// "request": ...,
// "settings": {
// "denied_labels": [...],
// "constrained_labels": { ... }
// }
// }
func NewSettingsFromValidationReq(payload []byte) (Settings, error) { // Note well: we don't validate the input JSON now, this has // already done inside of the `validate` function return newSettings( payload, "settings.denied_labels", "settings.constrained_labels")
} // Builds a new Settings instance starting from a Settings
// payload:
// {
// "denied_names": [ ... ],
// "constrained_labels": { ... }
// }
func NewSettingsFromValidateSettingsPayload(payload []byte) (Settings, error) { if !gjson.ValidBytes(payload) { return Settings{}, fmt.Errorf("denied JSON payload") } return newSettings( payload, "denied_labels", "constrained_labels")
} The heavy lifting of the setting is done inside of the newSettings function, which is invoked by both NewSettingsFromValidateSettingsPayload and NewSettingsFromValidationReq. The function takes the raw JSON payload and a list of gjson queries. These queries are used to extract the values from the JSON data and build the actual object: func newSettings(payload []byte, paths ...string) (Settings, error) { if len(paths) != 2 { return Settings{}, fmt.Errorf("wrong number of json paths") } data := gjson.GetManyBytes(payload, paths...) deniedLabels := mapset.NewThreadUnsafeSet() data[0].ForEach(func(_, entry gjson.Result) bool { deniedLabels.Add(entry.String()) return true }) constrainedLabels := make(map[string]*RegularExpression) var err error data[1].ForEach(func(key, value gjson.Result) bool { var regExp *RegularExpression regExp, err = CompileRegularExpression(value.String()) if err != nil { return false } constrainedLabels[key.String()] = regExp return true }) if err != nil { return Settings{}, err } return Settings{ DeniedLabels: deniedLabels, ConstrainedLabels: constrainedLabels, }, nil
} As you can see the code above is pretty straightforward. The gjson package provides a convenient method to fetch multiple values from the JSON data. The newSettings function also creates instances of regexp.Regexp objects and ensures the regular expressions provided by the user are correct. Note well: all the mapset.Set objects are deliberately created using their thread-unsafe variant . The WebAssembly code is executed in single thread, hence there are no concurrency issues. Moreover, the WebAssembly standard doesn't cover threads yet. See the official proposal for more details.

