All Kubewarden policies have to implement settings validation . This can be easily done by adding a Valid method to the Settings instances: func (s *Settings) Valid() (bool, error) { constrainedLabels := mapset.NewThreadUnsafeSet() for label := range s.ConstrainedLabels { constrainedLabels.Add(label) } constrainedAndDenied := constrainedLabels.Intersect(s.DeniedLabels) if constrainedAndDenied.Cardinality() != 0 { return false, fmt.Errorf("These labels cannot be constrained and denied at the same time: %v", constrainedAndDenied) } return true, nil
} The Valid method ensures no "denied" label is also part of the "constrained" map. The check is simplified by the usage of the Intersect method provided by mapset.Set. Note well: the Valid method is invoked against an already instantiated Setting object. That means the validation of the regular expression provided by the user already took place at inside of the Settings constructor. Finally, we have to ensure the validateSettings function that was automatically generated is changed to look like that: func validateSettings(payload []byte) ([]byte, error) { settings, err := NewSettingsFromValidateSettingsPayload(payload) if err != nil { // this happens when one of the user-defined regular expressions are invalid return kubewarden.RejectSettings( kubewarden.Message(fmt.Sprintf("Provided settings are not valid: %v", err))) } valid, err := settings.Valid() if valid { return kubewarden.AcceptSettings() } return kubewarden.RejectSettings( kubewarden.Message(fmt.Sprintf("Provided settings are not valid: %v", err)))
} As you can see, the function takes advantage of the helper functions provided by Kubewarden's SDK .

